import React from 'react';
import { Route, Switch } from 'react-router-dom';
import Styled from 'styled-components';
import { Home, WorkLog, UserList, Support, Setting } from './contents/';

export const ColorList = React.createContext({});
const $color = ['#B71C1C', '#FF6600', '#FFD600', '#00C853', '#338f6c', '#0099FF', '#6200EA', '#FF0084', '#3E2723', '#212121'];
const Contents = ({ activeMenu }) => {
  return (
    <ColorList.Provider value={$color}>
      <Main>
        <Switch>
          <Route path={'/'} exact component={Home} />
          <Route path={'/WorkLog'} component={WorkLog} />
          <Route path={'/UserList'} component={UserList} />
          <Route path={'/Support'} component={Support} />
          <Route path={'/Setting'} component={Setting} />
          <Route component={() => <>페이지가 없습니다.</>} />
        </Switch>
      </Main>
    </ColorList.Provider>
  )
}

const Main = Styled.div`
  width: calc(100% - 200px);
  height: 100%;
  float: left;
  background: #fff;
  border-radius: 20px;
  padding: 14px;
  overflow: hidden;
`;

export default Contents;
